import React, { Component } from 'react';
import './index.css';

const ColoredLine = ({ color, width }) => (
  <hr
    style={{
      color: color,
      backgroundColor: color,
      height: 1,
      width: width
    }}
  />
);

export class Navbar extends Component {
  Home(d) {
    if (d === 1) {
      window.scrollBy(0, 170);
    }
    if (d === 2) {
      window.scrollBy(0, 850);
    }
    if (d === 3) {
      window.scrollBy(0, 1500);
    }
    if (d === 4) {
      window.scrollBy(0, 2560);
    }
  }

  render() {
    return (
      <div className='d-flex justify-content-around ' style={{ width: '100%' }}>
        <div className='d-flex flex-column pl-5'>
          <div className='d-flex justify-content-around mt-5'>
            <button onClick={() => this.Home(1)}>Home</button>

            <button onClick={() => this.Home(2)}>Services</button>
            <button onClick={() => this.Home(3)}>Photos</button>
          </div>
          <ColoredLine color='#A89331' width='40vw' />
        </div>
        <a href='#middle'>
          <img
            className='logo'
            src={require('../../img/Bun-blanc.png')}
            alt='Navlogo'
          />
        </a>
        <div className='d-flex flex-column pr-5'>
          <div className='d-flex justify-content-around mt-5'>
            <button onClick={() => this.Home(4)}>Informations</button>
            <button>Contacts</button>
            <button>About us</button>
          </div>
          <ColoredLine color='#A89331' width='40vw' />
        </div>
      </div>
    );
  }
}

export default Navbar;
